class Solution:
    def minJumps(self, arr: List[int]) -> int:
        N = len(arr)
        if N <= 1:
            return 0

        graph = defaultdict(list)
        for i, num in enumerate(arr):
            graph[num].append(i)

        visited = [False] * N
        # Since the jumping action does not have any priority,
        # and we need to know the minimum steps,
        # we apply BFS approach.
        #
        # DFS approach does not work for this question,
        # because graph nodes do not have any priority and
        # we need to figure out the minimum steps to the goal.
        # DFS does not work for the purpose.
        current = [0]
        steps = 0
        while(current):
            next = []
            for cIdx in current:
                if cIdx == N - 1:
                    return steps

                if visited[cIdx]:
                    continue
                visited[cIdx] = True

                # Add a task if we doesn't visit cIdx - 1 yet
                if (0 <= cIdx - 1) and (visited[cIdx - 1] == False):
                    next.append(cIdx - 1)

                # Add a task if we doesn't visit cIdx + 1 yet
                if (cIdx + 1 < N) and (visited[cIdx + 1] == False):
                    next.append(cIdx + 1)

                # Jumping the indicies on the same number with arr[cIdx]
                for nIdx in graph[arr[cIdx]]:
                    if (visited[nIdx] == False):
                        next.append(nIdx)
                graph[arr[cIdx]].clear()

            current = next
            steps += 1

        return -1

def testWrapper(arr):
    return Solution().minJumps(arr)

checkTests(testWrapper)
